import './App.css';
import Main from './layouts/Main';
import { Route, Switch } from "react-router";

function App() {
  return (
    <Switch>
      <Route path="/about">
        <Main />
      </Route>

      <Route>
      <NoMatch />
    </Route>
    </Switch>

  );
}

export default App;
